import { Table, Button, Icon } from 'semantic-ui-react';
import ModalLayout from '../components/ModalLayout';
import RegisterUser from '../components/RegisterUser';
import {useEffect,useState} from 'react';
import axios from 'axios';

export default (props)=>{
    return(
        <Table basic='very' striped sortable celled >
            <Table.Header>
                <Table.Row>
                    {props.header.map((row,index)=>{
                        return (<Table.HeaderCell key={index}>
                            {row.name}
                        </Table.HeaderCell>
                    )})}               
                </Table.Row>
            </Table.Header>
            <Table.Body>
            {props.table.map((row) => (
                <Table.Row key={row.id}>
                    {props.header.map(({name,haschildren,children})=>(
                        <Table.Cell key={'cell'+row.id}>{haschildren?<>{row[name]}{children}</>:row[name]}</Table.Cell>
                    ))}
                </Table.Row>
            ))}
            </Table.Body>
        </Table>
    );
}
